  \"2013-03-15T22:40:35.616022\",\n\t\"name\": \"oregon-well-log-observational-data\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains well log observations
  compiled by the Oregon Department of Geology and Mineral Industries, and published
  as a Web feature service for the National Geothermal Data System. Fields in the
  Well Log Observation Content Model will become XML elements in interchange documents
  for WMS simple features provided by a node in the USGIN network. Each observation
  includes a Log URI, API Number, Latitude and Longitude spatially referenced to EPSG:
  4326 (for interoperability). The data contained in the submitted dataset is available
  as an Excel Spreadsheet, ESRI service, WMS and WFS service. Link to Well Log Observation
  Content Model: http://stategeothermaldata.org/data_delivery/content_models/well_log_observation.
